import React, { useState } from 'react';
import './split.scss';

function DoubleRangeSlider() {
  const [rangeValues, setRangeValues] = useState([0, 100]); // 범위의 초기 값 설정

  const handleChange = (event, newValue) => {
    setRangeValues(newValue);
  };

  return (
    <div>
      <span>
        범위: {rangeValues[0]} - {rangeValues[1]}
      </span>
      <input
        type="range"
        min={0}
        max={100}
        step={1}
        value={rangeValues[0]}
        onChange={(e) =>
          handleChange(e, [parseInt(e.target.value), rangeValues[1]])
        }
      />
      <input
        type="range"
        min={0}
        max={100}
        step={1}
        value={rangeValues[1]}
        onChange={(e) =>
          handleChange(e, [rangeValues[0], parseInt(e.target.value)])
        }
      />
    </div>
  );
}

export default DoubleRangeSlider;
